import axios from "axios";

const api = axios.create({
  baseURL: "https://test-api.atom6studio.com",
});

export default {
  checkToken: async (token) => {
    const response = await api.get("/auth/check", {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    return response;
